import React from 'react';

export default function Footer() {
  return (
    <footer>
      <p>© 2024 שמי, כל הזכויות שמורות.</p>
      <a href="https://linkedin.com">לינקדין שלי</a>
      <a href="https://github.com">גיטהאב שלי</a>
    </footer>
  );
}
